Query text is constant, but the values might change. You can pass changing values to a query by specifying a list of variables as bound values. Each ? in query text will be filled with the matching value. Never pass values by adding strings, this could lead to SQL Injection Each list of values to send in a query must implement the trait ValueList. By default this can be a slice &[] or a tuple () (max 16 elements) of values to send. A few examples: # extern crate scylla;
# use scylla::Session;
# use std::error::Error;
# async fn check_only_compiles(session: &Session) -> Result<(), Box<dyn Error>> {
// Empty slice means that there are no values to send
session.query("INSERT INTO ks.tab (a) VALUES(1)", &[]).await?; // Empty tuple/unit also means that there are no values to send
session.query("INSERT INTO ks.tab (a) VALUES(1)", ()).await?; // Sending three integers using a slice:
session .query("INSERT INTO ks.tab (a, b, c) VALUES(?, ?, ?)", [1_i32, 2, 3].as_ref()) .await?; // Sending an integer and a string using a tuple
session .query("INSERT INTO ks.tab (a, b) VALUES(?, ?)", (2_i32, "Some text")) .await?; // Sending a single value as a tuple requires a trailing coma (Rust syntax):
session.query("INSERT INTO ks.tab (a) VALUES(?)", (2_i32,)).await?; // Each value can also be sent using a reference:
session .query("INSERT INTO ks.tab (a, b) VALUES(?, ?)", &(&2_i32, &"Some text")) .await?;
# Ok(())
# }

