Prepared queries have good performance, much better than simple queries. By default they use shard/token aware load balancing. Always pass partition key values as bound values. Otherwise the driver can't hash them to compute partition key and they will be sent to the wrong node, which worsens performance. Let's say we have a table like this: TABLE ks.prepare_table ( a int, b int, c int, PRIMARY KEY (a, b)
) # extern crate scylla;
# use scylla::Session;
# use std::error::Error;
# async fn check_only_compiles(session: &Session) -> Result<(), Box<dyn Error>> {
use scylla::prepared_statement::PreparedStatement; // WRONG - partition key value is passed in query string
// Load balancing will compute the wrong partition key
let wrong_prepared: PreparedStatement = session .prepare("INSERT INTO ks.prepare_table (a, b, c) VALUES(12345, ?, 16)") .await?; session.execute(&wrong_prepared, (54321,)).await?; // GOOD - partition key values are sent as bound values
// Other values can be sent any way you like, it doesn't matter
let good_prepared: PreparedStatement = session .prepare("INSERT INTO ks.prepare_table (a, b, c) VALUES(?, ?, 16)") .await?; session.execute(&good_prepared, (12345, 54321)).await?; # Ok(())
# }

