session.use_keyspace("my_keyspace", false).await?; // lowercase name with case sensitivity will use my_keyspace
session.use_keyspace("my_keyspace", true).await?; // uppercase name without case sensitivity will use my_keyspace
session.use_keyspace("MY_KEYSPACE", false).await?; // uppercase name with case sensitivity will use MY_KEYSPACE
session.use_keyspace("MY_KEYSPACE", true).await?;
